import Dot from "./dot";
import HorizontalLine from "./horizontal_line";

const RowWithDots = () => {
    return (
        <div className="row_with_dots">
            <Dot/>
            <HorizontalLine/>
            <Dot/>
            <HorizontalLine/>
            <Dot/>
            <HorizontalLine/>
            <Dot/>
        </div>
    )
}

export default RowWithDots;
